ateName":"santa's bf","description":"guy with bad opinions\n\nhttps://boxd.it/3Imn3\n^^^^LETTERBOXD ^^^^\n\nA7X fan foREVer\n\nrest in peace prince of darkness\n\nFREE CAM","url":"https://musicboard.app/groovesmas/"},"dateCreated":"2024-07-02T14:11:50.681747Z","headline":"A Titanic Double Album","name":"A Titanic Double Album","reviewBody":"I don't listen to double albums much, mostly because they can be extremely boring if they aren't great, but this has got to be the best one I've heard. Robert Plant thankfully doesn't do his annoying vocals that he did on Houses of the Holy, and he gives some of his most emotional and incredible performances on here. The first disc is flawless, with some of the band's most epic songs like In My Time of Dying and the monumental Kashmir. The Rover is another classic, with amazing riffs and good vocals, Houses of the Holy is a great song that was left off the last album for some strange reason, and Trampled Under Foot is super funky and catchy. Custard Pie is definitely good but I think it's easily the worst on the first half of the album. Now, we move into Disc 2 with the proggy In the Light, and then the nice little acoustic Bron-Yr-Aur. Down by the Seaside is a good little song, but then you get Ten Years Gone, which is one of the best classic rock songs I've ever heard. Night Flight is pretty catchy, The Wanton Song is pretty heavy and awesome, but then you get to the end. I really don't enjoy the last three songs at all. They're not really bad, just painfully mediocre. If those two of those three closing songs were thrown out, and Achilles Last Stand was put in as an epic closer, I think this would beat Led Zeppelin IV, but as it is now Physical Graffiti is still a close second in Zeppelin's discography.\n\nAlbum Art Review: 9/10 - It's a super iconic picture, and it's just a good looking building overall that they decided to make the art.\n\nSong Ranking:\n15. Black Country Woman - 6.5/10\n14. Boogie with Stu - 7/10\n13. Bron-Yr-Aur - 7.5/10\n12. Sick Again - 7.5/10\n11. Down by the Seaside - 8/10\n10. Night Flight - 8/10\n9. Custard Pie - 8/10\n8. The Wanton Song - 8.5/10\n7. Houses of the Holy - 8.5/10\n6. In the Light - 8.5/10\n5. Trampled Under Foot - 9/10\n4. In My Time of Dying - 9.5/10\n3. The Rover - 9.5/10\n2. Ten Years Gone - 10/10\n1. Kashmir - 10/10\n\nAverage Song Rating: 8.5","inLanguage":"en","reviewRating":{"@type":"Rating","bestRating":5,"worstRating":0.5,"ratingValue":4.5}},"isFamilyFriendly":true}</script>
